Vue.config.devtools=!0,Vue.config.debug=!0,new Vue({el:"#resourceGetContainer",data:{repoList:[],organization:"",loading:!1},ready:function(){},methods:{loadRepositories:function(){var e="https://api.github.com/users/"+this.organization+"/repos";this.loading=!0,this.$http.get(e).then(function(t){this.loading=!1,this.repoList=t.data},function(t){this.loading=!1,this.repoList=[]})}}});